INSERT INTO `lg_news` (`NewsID`, `Title`, `HeaderImage`, `Body`, `DatePosted`) VALUES
(2, 'LG to release BTS edition smartphone', 'images/news/01-BTS-2018-press-photo-BigHit-Entertainment-billboard-1548.jpg', '\r\nLG have announced that they\'ll be releasing a special LG Q7 BTS Edition phone with exclusive additions just for BTS fans.\r\n\r\nThe special version of the smartphone will include BTS features like the members\' handwritten emoticons, BTS wallpapers that change automatically daily, ringtones and good morning/good night alerts recorded by the members.\r\n\r\nThere will also be a special BTS app and gallery pre-installed on the phone. Even the earphones and charger will carry BTS\' official logo as will the back of the phone.', '2018-09-17 06:26:54'),
(3, 'Count them: 1, 2, 3 rear cameras on the LG V40 ThinQ.', 'images/news/01.jpg', 'Even just a few years ago, a 64-gigabyte repository of storage was pretty standard. Now, times have changed. LG and Google offer you 64GB just to start with. Samsung\'s Galaxy Note 9 ups the ante to 128GB at its lowest price, or you can pay more for 512GB. That doesn\'t even include the 512GB of external storage you can add with a microSD card.\r\n\r\nApple, meanwhile, gives the iPhone XS Max three storage options: 64GB, 256GB and 512GB, with no expandable storage. So although LG\'s V40 ThinQ does let you expand up to 2 terabytes (in theory; the microSD card market tops out at 512GB right now), the total falls behind Samsung\'s largest capacity. Google, meanwhile, maxes out at 128GB total, though it gives you unlimited photo storage online with Google Photos.', '2018-09-17 06:29:43');

